    <style>
        @keyframes rotato {
            0% {
                rotate: 0deg;
            }
            100% {
                rotate:360deg;
            }
            
        }
        @-webkit-keyframes rotato {
            0% {
                rotate: 0deg;
            }
            100% {
                rotate:360deg;
            }
        }
        body {
            margin:0;
            background-color: hotpink;
            color:blue;
            text-shadow: 4px 4px 0px #FFFF00;
            overflow-x: hidden;
        }
        .logo {
            height:10vh;
            width:500px;
            transition: 1s;
        }
        .logo:hover {
            width:100%;
        }
        .gifs {
            height:90vh;
            width:100%;
            display:flex;
            flex-wrap: wrap;
            align-items: stretch;
        }
        .gif {
            width:20%;
            height:45vh;
        }
        .gif > img {
            width:100%;
            height:100%;
            transition: 1s;
        }
        .gif > img:hover {
            rotate: 360deg;
            border-radius:50%;
        }
        h1:hover {
            font-stretch: narrower;
        }
        h1 {
            margin:0;
        }
        .kys {
            font-size:16px;
            transition: 1s;
            height:90vh;
            margin:0;
            padding:0;
            animation-duration: 10s;
            animation-name: rotato;
            animation-iteration-count: infinite;
            animation-timing-function: linear;
            display: flex;
            align-items: center;
            justify-content: center;
        }
        .kys:hover {
            font-size: 64px;
            background: url('https://media.tenor.com/58MHehmspf8AAAAM/saddam-hussein-adobada.gif');
        }
    </style>
